import "./App.css";

function App() {
  return (
    <>
      <main>
        <table>
          <tr>
            <th>Header 1</th>
            <th>Header 2</th>
          </tr>
          <tr>
            <td colspan="2">This cell spans two columns</td>
          </tr>
        </table>
      </main>
    </>
  );
}

export default App;
